import React from 'react';
import ReactDOM from 'react-dom';
var Greeting = ()=> {

  return (
    <React.Fragment>

  <div>
    <p>Hello</p>
    <h1>Hello</h1>
  </div>
  <ul>
    <li>Logesh</li>
  </ul>
  </React.Fragment>
  );

}

ReactDOM.render(<Greeting />,document.getElementById('root'));
